// import awsome10 from '../src/images/awsome10.jpg'

function app() {

    const url = `https://api.open-meteo.com/v1/forecast?latitude=47.0042&longitude=28.8574&current=temperature_2m,wind_direction_10m,wind_speed_10m&hourly=temperature_2m,relative_humidity_2m,wind_speed_10m`

    fetch(url).then((data) => {
            return data.json();
        }).then((info) => {
            renderWeather(info.current)
            console.log(info)
        })


        function renderWeather(data) {
            const div = document.createElement('div')
            div.textContent = `
            Temperature: ${data.temperature_2m}
            Wind Speed: ${data.wind_speed_10m}
            now: ${data.is_day === 0 ? 'night' : 'day'}
            `

            const currTemp = Math.round(data.temperature_2m)
            console.log(currTemp)
            
            const windSpeed = data.wind_speed_10m
            console.log(windSpeed)

            const winddirec = data.wind_direction_10m
            console.log(winddirec)

            document.body.append(div)
        

        function getWindDirections(degrees) {
            const directions = ['North', 'North-East', 'East', 'South-East', 'South', 'South-West', 'West', 'North-West']
            const index = Math.round((degrees % 360) / 45);
            return directions[index % 8];
        }
        const windDirection = getWindDirections(data.wind_direction_10m)
        console.log(windDirection)
    }

        const today = new Date()
        const currentDay = today.getDay()
        const week = ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thrusday', 'Friday', 'Saturday']
        const getDay = week[currentDay]
        console.log(getDay)


        // const url2 = 'https://weatherapi-com.p.rapidapi.com/future.json?q=London&dt=2024-02-28&lang=english';
        // const options = {
        //     method: 'GET',
        //     headers: {
        //         'X-RapidAPI-Key': 'c12d18beb4msh39d8a92640c83a3p1bb4e2jsn846302c8523f',
        //         'X-RapidAPI-Host': 'weatherapi-com.p.rapidapi.com'
        //     }
        // };
        
        // try {
        //     const response = fetch(url2, options);
